import React from "react";
import "./AppDisplay.css";

function AppDisplay(props) {
  return (
    <>
      <div className={props.style}>
        <h1 className="title">{props.title}</h1>
        <h2 className="subtitle">{props.subtitle}</h2>
      </div>
    </>
  );
}

export default AppDisplay;
